import { gql, useQuery } from '@apollo/client';

export const CURRENT_USER_QUERY = gql`
  query {
    authenticatedItem {
      ... on User {
        id
        email
        name
        # query cart
      }
    }
  }
`;

export function useUser() {
  const { data } = useQuery
}
